/*Next, I use Lateral Cross Joins along with another json_to_recordset to associate each series with the array read from interpreting
the JSON.  The data is all read into a table called "Data_Clean"*/

Drop Table IF EXISTS DataClean;

SELECT Part1Raw."seriesID", x.year, x.period, x.value
INTO DataClean
FROM Part1Raw CROSS JOIN LATERAL
	json_to_recordset(Part1Raw.data) as
	x(seriesID text, year integer, period text, periodname text, value float, footnotes text);

INSERT INTO DataClean
	("seriesID",
	year,
	period,
	value)

